import Footer from "../components/Footer";
import Header from "../components/Header";
import HeroSection from "../components/HeroSection";

const Home = () => {
  return (
    <div className="text-primary dark:text-white bg-white dark:bg-black">
      <Header />
      <HeroSection />
      <Footer />
    </div>
  );
};

export default Home;
